import styles from "./ResourceCard.module.scss";
const ResourceCard = (props) => {
	return (
		<div className={styles.ResourceCard}>
			<div>
				<h2>
					<a>{props.name}</a>
				</h2>
			</div>
		</div>
	);
};

export default ResourceCard;
